import React, { Fragment, useState } from "react";
import "./List.css";

function List({ data }) {
  const [expanded, setExpand] = useState({
    isExpanded: false,
    expandedIndex: -1,
  });

  const handleListExpand = (index) => {
    return <List data={data[index]?.child} />;
  };

  return (
    <div className="list__container">
      <ul className="list__items">
        {console.log(data)}
        {data &&
          data.map((d, index) => {
            console.log(d);
            return (
              <Fragment key={index}>
                <li
                  className="list__item"
                  onClick={() => handleListExpand(index)}
                >
                  {d.title}
                  <ul className="sublist__container">
                    <li className="list__item">Hello</li>
                  </ul>
                </li>
              </Fragment>
            );
          })}
      </ul>
    </div>
  );
}

export default List;
